          <Route path="orders" element={<Orders />} />
          <Route path="settings"  element={<General />}/>
          <Route path="request-form"  element={<RequestForm />}/>
          <Route path="request-form/new"  element={<RequestFormNew />}/> */}
        </Route>
        <Route path="*" element={<NoPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
